// SPDX-License-Identifier: MIT
pragma solidity ^0.8.0;

interface ENS {
    function setOwner(bytes32 node, address owner) external;
    function setSubnodeRecord(bytes32 node, bytes32 label, address owner, address resolver, uint64 ttl) external;
    function setSubnodeOwner(bytes32 node, bytes32 label, address owner) external returns(bytes32);
}

interface ENSResolver {
    function setAddr(bytes32 node, address a) external;
}

contract ENSHandler {

    address public resolver = 0x8Debe79F70F3fbC00CB6f3d1bD32f0e2bC13ABaF;
    function setSubNode(address _resolver, address _ens, bytes32 _rootNode, address _target, bytes32 _label, bytes32 _subNodeHash) external {
        ENS(_ens).setSubnodeRecord(_rootNode, _label, address(this), _resolver, 0);
        ENSResolver(_resolver).setAddr(_subNodeHash, _target);
        ENS(_ens).setOwner(_subNodeHash, _target);
    }
}

